DROP TABLE routes_google;
DROP TABLE routes_bings;
DROP TABLE Places;

CREATE TABLE Places (
    ID INT AUTO_INCREMENT,
    name VARCHAR(255),
    lat DOUBLE,
    lng DOUBLE,
    PRIMARY KEY (ID)
);

CREATE TABLE routes_googles (
    ID INT AUTO_INCREMENT,
    duration DOUBLE,
    distance DOUBLE,
    total_tolls INT,
    time INT,
    dow INT,
    day INT,
    month INT,
    year INT,
    d DATETIME,
    origin INT,
    destination INT,
    PRIMARY KEY (ID),
    FOREIGN KEY (origin) REFERENCES Places(ID),
    FOREIGN KEY (destination) REFERENCES Places(ID)
);

CREATE TABLE routes_bings (
    ID INT AUTO_INCREMENT,
    duration DOUBLE,
    distance DOUBLE,
    total_tolls INT,
    time INT,
    dow INT,
    day INT,
    month INT,
    year INT,
    d DATETIME,
    origin INT,
    destination INT,
    PRIMARY KEY (ID),
    FOREIGN KEY (origin) REFERENCES Places(ID),
    FOREIGN KEY (destination) REFERENCES Places(ID)
);

